window.bookSummaryJSON = "<p><b>After being scattered across the globe, our heroes seek to reunite with each other. But the consequences of recent events continue to plague them.</b></p> <p>Cooper enters the Fertile Desert, in search of Nabi. Katherine seeks to escape the drow island, and take back her ship. Julian tries to placate Akane, while keeping Chaz out of trouble. Stacy, having deemed Dave a lost cause, vows revenge on the ettins, who continue their destructive rampage in the Cedar Wilds. Dave, finally free of Stacy's yoke, sets his sights on power and wealth. And Tim....What the hell is Tim up to?</p> <p>Meanwhile, Mordred's army of brainwashed Knights spread ever farther, in their search for his dice.</p>"; 
